import React from "react";
import TextField from "@material-ui/core/TextField";
import "./App.css";
import { Button } from "@material-ui/core";

function App() {
  const handleClick = () => {
    console.log("Kompilerer");
  };
  return (
    <div className="App">
      <TextField
        id="input"
        label="Kode"
        multiline
        rows="4"
        defaultValue="Default Value"
        variant="outlined"
      />
      <Button variant="contained" onClick={handleClick}>
        Kompiler
      </Button>
      <TextField
        id="output"
        label="Multiline"
        multiline
        rows="4"
        defaultValue="Default Value"
        variant="outlined"
      />
    </div>
  );
}

export default App;
